function TestInfo({record, setRecord}) {

  //handle submit functions

  return(
     <div>

        <div className='head_schedule'> 
                  <h5>Created:  <em> {} </em></h5>
        </div>

      <div className='test_request'>
            <label>
              Test Name: 
              <input type='text' value={record.name}
                  onChange={(event) => 
                  setRecord({...record, name: event.target.value})
                  }
                  />
            </label>
      </div>

     </div>
     ); 

}

export default TestInfo
